

import React, { useState } from 'react';
// LocalDining, Fastfood, LocalDrink icons are no longer needed as we use images
// import { LocalDining, Fastfood, LocalDrink } from '@mui/icons-material'; 
import { ProductType } from '../types';
import Product from '../components/Product';
import { motion } from 'framer-motion';

// --- IMAGE MAPPING ---
// Use a dictionary to store images for each category.
// ⚠️ IMPORTANT: Please replace these placeholder image links with your actual high-quality, professional food images.
const categoryImages: { [key: string]: string } = {
  'Starter': 'data:image/jpeg;base64,',
  'Chinies Rics & Gravy': 'data:image/jpeg;base64,',
  'Pakistani Food': 'data:image/jpeg;base64,',
    'Special BAR B Q': 'data:image/jpeg;base64,',
  'Salads': 'data:image/jpeg;base64,',
  'Beverages': 'data:image/jpeg;base64,',
  'Shakes & Mocktail Drinks': 'data:image/jpeg;base64,',
  'Burgers': 'data:image/jpeg;base64,',
  'Fast Food': 'https://placehold.co/600x400/5733FF/FFFFFF/png?text=Classic+Fast+Food',
  'Shahi Special Pizza': 'https://placehold.co/600x400/FF3357/FFFFFF/png?text=Shahi+Special+Pizza',
  'Pizza': 'data:image/jpeg;base64,',
  'Shahi FastFood Deal': 'https://placehold.co/600x400/8833FF/FFFFFF/png?text=FastFood+Combo+Deals',
};


interface ShopProps {
  cart: ProductType[];
  addToCart: (product: ProductType) => void;
  increaseQuantity: (id: number) => void;
  decreaseQuantity: (id: number) => void;
  removeFromCart: (id: number) => void;
}

interface CategoryButtonProps {
  onClick: () => void;
  text: string;
  categoryImage: string; // New prop for image URL
}

// Refactored CategoryButton to be an Image Card
const CategoryButton: React.FC<CategoryButtonProps> = ({ onClick, text, categoryImage }) => (
  <motion.button
    onClick={onClick}
    className="relative w-full aspect-square overflow-hidden rounded-xl shadow-xl transition-all duration-300 transform hover:scale-[1.05] active:scale-[0.98] group"
    initial={{ opacity: 0, y: 50 }}
    animate={{ opacity: 1, y: 0 }}
    transition={{ type: 'spring', stiffness: 100 }}
  >
    {/* Background Image */}
    <img
      src={categoryImage}
      alt={text}
      className="w-full h-full object-cover transition-transform duration-500 group-hover:scale-110"
      // Fallback for image loading error
      onError={(e) => {
        const target = e.target as HTMLImageElement;
        target.onerror = null;
        target.src = 'https://placehold.co/600x400/cccccc/000000?text=Image+Missing'; 
      }}
    />

    {/* Text Overlay with Gradient for Professional Look */}
    <div className="absolute inset-0 bg-gradient-to-t from-black/80 via-black/40 to-transparent flex items-end p-4">
      <h3 className="text-white text-lg sm:text-xl font-bold text-left drop-shadow-lg leading-tight">
        {text}
      </h3>
    </div>
  </motion.button>
);


const Shop: React.FC<ShopProps> = ({ cart, addToCart, increaseQuantity, decreaseQuantity, removeFromCart }) => {
  const [selectedCategory, setSelectedCategory] = useState<string | null>(null);


  const allProducts: ProductType[] = [
    { id: 1, title: 'Fish Cracker', price: 399, imageUrl: '', quantity: 0, category: 'Starter' },
    { id: 2, title: 'ButterFly Chicken', price: 1249, imageUrl: 'https://i.pinimg.com/474x/e7/11/4c/e7114c2fcc764f73dad68b5f10423dbc.jpg', quantity: 0, category: 'Starter' }
    // Add more products here as needed
  ]

const filteredProducts = selectedCategory
    ? allProducts.filter(product => product.category === selectedCategory)
    : allProducts;

  return (
    <div className="container mx-auto p-4 md:p-6 max-h-screen overflow-y-auto">
    {/* --- CATEGORY VIEW (IMAGE CARDS) --- */}
    {selectedCategory === null ? (
      <div className="grid grid-cols-2 gap-4 sm:grid-cols-3 lg:grid-cols-4 xl:grid-cols-5 mb-6">
      <CategoryButton
        onClick={() => setSelectedCategory('Starter')}
        text="Starter"
        categoryImage={categoryImages['Starter']}
      />
      <CategoryButton
        onClick={() => setSelectedCategory('Chinies Rics & Gravy')}
        text="Chinies Rics & Gravy"
        categoryImage={categoryImages['Chinies Rics & Gravy']}
      />
      <CategoryButton
        onClick={() => setSelectedCategory('Pakistani Food')}
        text="Pakistani Food"
        categoryImage={categoryImages['Pakistani Food']}
      />
      <CategoryButton
        onClick={() => setSelectedCategory('Special BAR B Q')}
        text="Special BAR B Q"
        categoryImage={categoryImages['Special BAR B Q']}
      />
      <CategoryButton
        onClick={() => setSelectedCategory('Salads')}
        text="Salads"
        categoryImage={categoryImages['Salads']}
      />
      <CategoryButton
        onClick={() => setSelectedCategory('Beverages')}
        text="Beverages"
        categoryImage={categoryImages['Beverages']}
      />
      <CategoryButton
        onClick={() => setSelectedCategory('Shakes & Mocktail Drinks')}
        text="Shakes & Mocktail Drinks"
        categoryImage={categoryImages['Shakes & Mocktail Drinks']}
      />
      <CategoryButton
        onClick={() => setSelectedCategory('Fast Food')}
        text="Fast Food"
        categoryImage={categoryImages['Fast Food']}
      />
      <CategoryButton
        onClick={() => setSelectedCategory('Pizza')}
        text="Pizza"
        categoryImage={categoryImages['Pizza']}
      />
      
    </div>
    
     
    ) : (
      // --- PRODUCT LIST VIEW ---
      <div>
       {/* Back Button */}
       <button
        onClick={() => setSelectedCategory(null)}
        className="relative mb-6 bg-gradient-to-r from-red-600 to-red-800 p-3 w-32 h-12 text-lg rounded-full text-white font-bold shadow-lg flex items-center justify-center overflow-hidden transition-transform transform hover:scale-105 active:scale-95 focus:outline-none focus:ring-2 focus:ring-red-400 group"
      >
        <span className="absolute inset-0 bg-red-900 opacity-30 transform -translate-x-12 -translate-y-12 rounded-full transition-all duration-300 ease-in-out group-hover:translate-x-0 group-hover:translate-y-0"></span>
        <span className="relative z-10">Back</span>
      </button>

        <h2 className="text-3xl font-extrabold text-gray-800 mb-6 border-b pb-2">{selectedCategory} Menu</h2>

        <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 xl:grid-cols-5 gap-4">
          {filteredProducts.length > 0 ? (
            filteredProducts.map(product => (
              <Product
                key={product.id}
                product={product}
                cartItem={cart.find(item => item.id === product.id)}
                addToCart={addToCart}
                increaseQuantity={increaseQuantity}
                decreaseQuantity={decreaseQuantity}
                removeFromCart={removeFromCart}
              />
            ))
          ) : (
            <div className="col-span-full">
              <p className="text-center text-gray-500 p-8 border border-dashed rounded-lg">
                No products currently available for the category: <span className="font-semibold text-gray-700">{selectedCategory}</span>.
              </p>
            </div>
          )}
        </div>
      </div>
    )}
  </div>
  );
}

export default Shop;